import "antd/dist/antd.css";
import Home from "./container/Home";
import { BrowserRouter as Router, Route } from "react-router-dom";
import React, { useState, useEffect } from 'react';
import Layout from "antd/lib/layout/layout";
import { Content } from 'antd/lib/layout/layout';
import Navigation from "./container/Navigation";
import Footer from "./container/Footer";
import Header from "./container/Header";
import Ao from "./container/components/Ao";
import { Col, Row } from "antd";
import Balo from "./container/components/Balo";
import Giay from "./container/components/Giay";
import AllProduct from "./container/components/AllProduct";
import axios from "axios";

function App() {
  const [ListProductHome, setListProductHome] = useState([]);
  useEffect(() => {
      axios.get('http://localhost:3001/san-pham/api/product'
      ).then(res => { setListProductHome(res.data) })
  }, []);
  return (
    <>
      <Router>
        <Layout>
          <Header />
          <Row >
            <Col>
              <Navigation />
            </Col>
            <Col span={18} push={1} width={'100%'}>
              <Content className="content-wrapper">
                <Route exact path="/">
                  <Home />
                </Route>
                <Route path="/all">
                  <AllProduct product={ListProductHome} />
                </Route>
                <Route path="/Ao">
                  <Ao />
                </Route>
                <Route path="/Balo">
                  <Balo />
                </Route>
                <Route path="/Giaydep">
                  <Giay />
                </Route>
              </Content>
            </Col>
          </Row>



          <Footer />
        </Layout>
      </Router>
    </>

  );
}

export default App;
